import * as FaIcons from "react-icons/fa";
import * as BaIcons from "react-icons/bs";
import { Link } from 'react-router-dom';

import { Sidebar, Menu, MenuItem, SubMenu ,useProSidebar } from "react-pro-sidebar";
function SidebarData() {
  const { collapseSidebar } = useProSidebar();
  return (
    <>
      <Sidebar>
        <Menu>
        <MenuItem icon={<FaIcons.FaHome className="fs-5"/>} routerLink={<Link to="/" />}> Dashboard</MenuItem>
          <SubMenu icon={ <FaIcons.FaUserCheck className="fs-5"/>} label="Admin users">
            <MenuItem routerLink={<Link to="/java" />}> List all Admin-users </MenuItem>
            <MenuItem> Add Admin-users</MenuItem>
          </SubMenu>

          <SubMenu icon={ <FaIcons.FaBriefcase className="fs-5"/>} label="Ad">
            <MenuItem> List Ad </MenuItem>
            <MenuItem> Add New Ads </MenuItem>
          </SubMenu>
          
          <SubMenu icon={ <FaIcons.FaBriefcase className="fs-5"/>} label="Jobs">
            <MenuItem> List Jobs </MenuItem>
            <MenuItem> Add Jobs </MenuItem>
          </SubMenu>
            
          <SubMenu icon={ <FaIcons.FaBriefcase className="fs-5"/>} label="Coma">
            <MenuItem> List Jobs </MenuItem>
            <MenuItem> Add Jobs </MenuItem>
          </SubMenu>
        </Menu>
      </Sidebar>
      {/* <main>
        <button onClick={() => collapseSidebar()}>Collapse</button>
      </main> */}
    </>
  );
}
export default SidebarData;
